// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

contract AdContract {
    struct Ad {
        uint256 advertiserId;   //  ID (JWT userId  )
        uint256 reward;         // 
        uint256 maxInfluencer;  //   
        uint256 deadline;       //    timestamp
        bytes32 metadataHash;   //     
        uint256 acceptedCount;  //  
        bool isClosed;
    }

    struct Influencer {
        uint256 influencerId;   //  ID (JWT userId  )
        bool paid;
        uint256 joinTime;
    }

    mapping(uint256 => Ad) public ads;
    mapping(uint256 => mapping(uint256 => Influencer)) public adInfluencerMap; // adId => influencerId => Influencer
    mapping(uint256 => mapping(uint256 => bool)) public hasJoinedAd; //   : adId => influencerId => bool

    uint256 public nextAdId;
    // nextInfluencerId  - JWT userId   

    //  
    event AdCreated(uint256 indexed adId, uint256 indexed advertiserId, uint256 reward);
    event DepositSuccess(address indexed user, uint256 amount);
    event JoinedAd(uint256 indexed adId, uint256 indexed influencerId);
    event PaidInfluencer(uint256 indexed adId, uint256 indexed influencerId, address indexed walletAddress, uint256 reward);
    event RefundedAdvertiser(uint256 indexed adId, uint256 indexed advertiserId, address indexed walletAddress, uint256 amount);

    constructor() {
        nextAdId = 0;
        // nextInfluencerId  
    }

    // () 
    function deposit() public payable {
        require(msg.value > 0, "Amount must be greater than 0");
        emit DepositSuccess(msg.sender, msg.value);
    }

    //     - advertiserId  
    function addContract(
        uint256 advertiserId,   //  JWT userId  
        uint256 reward,
        uint256 maxInfluencer,
        uint256 deadline,
        bytes32 metadataHash
    ) public payable {
        require(msg.value >= reward * maxInfluencer, "Insufficient payment for all rewards");
        require(reward > 0, "Reward must be greater than 0");
        require(maxInfluencer > 0, "Max influencer must be greater than 0");
        require(deadline > block.timestamp, "Deadline must be in the future");
        require(advertiserId > 0, "Invalid advertiser ID"); //    

        //    -  advertiserId 
        ads[nextAdId] = Ad({
            advertiserId: advertiserId, //  JWT userId  
            reward: reward,
            maxInfluencer: maxInfluencer,
            deadline: deadline,
            metadataHash: metadataHash,
            acceptedCount: 0,
            isClosed: false
        });

        emit AdCreated(nextAdId, advertiserId, reward); 
        nextAdId++;
    }

    function joinAd(uint256 adId, uint256 influencerId) public {
        require(adId < nextAdId, "Invalid adId");
        require(influencerId > 0, "Invalid influencer ID");

        Ad storage ad = ads[adId];

        require(!ad.isClosed, "Ad is closed");
        require(ad.acceptedCount < ad.maxInfluencer, "Max influencers reached");
        require(ad.deadline > block.timestamp, "Deadline passed");
        require(!hasJoinedAd[adId][influencerId], "Already joined");

        adInfluencerMap[adId][influencerId] = Influencer({
            influencerId: influencerId, 
            paid: false,
            joinTime: block.timestamp
        });

        hasJoinedAd[adId][influencerId] = true;

        ad.acceptedCount++;

        if (ad.acceptedCount >= ad.maxInfluencer) {
            ad.isClosed = true;
        }

        emit JoinedAd(adId, influencerId); 
    }

    //   (   )
    function payInfluencer(uint256 adId, uint256 influencerId, address walletAddress) public {
        require(adId < nextAdId, "Invalid adId");
        require(influencerId > 0, "Invalid influencer ID");
        require(walletAddress != address(0), "Invalid wallet address");

        Ad storage ad = ads[adId];
        Influencer storage inf = adInfluencerMap[adId][influencerId];

        require(inf.influencerId != 0, "Influencer not joined");
        require(!inf.paid, "Already paid"); 
        require(address(this).balance >= ad.reward, "Insufficient balance"); 

        inf.paid = true;
        payable(walletAddress).transfer(ad.reward); //

        emit PaidInfluencer(adId, influencerId, walletAddress, ad.reward);
    }

    //    
    function payMultipleInfluencers(
        uint256 adId, 
        uint256[] memory influencerIds, 
        address[] memory walletAddresses
    ) public {
        require(adId < nextAdId, "Invalid adId");
        require(influencerIds.length == walletAddresses.length, "Arrays length mismatch");
        require(influencerIds.length > 0, "Empty arrays");

        Ad storage ad = ads[adId];
        require(address(this).balance >= ad.reward * influencerIds.length, "Insufficient balance");

        for (uint256 i = 0; i < influencerIds.length; i++) {
            uint256 influencerId = influencerIds[i];
            address walletAddress = walletAddresses[i];

            require(influencerId > 0, "Invalid influencer ID");
            require(walletAddress != address(0), "Invalid wallet address");

            Influencer storage inf = adInfluencerMap[adId][influencerId];
            require(inf.influencerId != 0, "Influencer not joined");
            require(!inf.paid, "Already paid");

            inf.paid = true;
            payable(walletAddress).transfer(ad.reward);

            emit PaidInfluencer(adId, influencerId, walletAddress, ad.reward);
        }
    }

    //     (  )
    function refundAdvertiser(uint256 adId, address advertiserWalletAddress) public {
        require(adId < nextAdId, "Invalid adId");
        require(advertiserWalletAddress != address(0), "Invalid wallet address");

        Ad storage ad = ads[adId];
        require(block.timestamp > ad.deadline, "Deadline not passed yet");

        uint256 refundAmount = address(this).balance;
        require(refundAmount > 0, "No funds to refund");

        payable(advertiserWalletAddress).transfer(refundAmount);

        emit RefundedAdvertiser(adId, ad.advertiserId, advertiserWalletAddress, refundAmount);
    }

    //    
    function getInfluencerInfo(uint256 adId, uint256 influencerId) public view returns (uint256, bool, uint256) {
        Influencer memory inf = adInfluencerMap[adId][influencerId];
        return (inf.influencerId, inf.paid, inf.joinTime);
    }

    //   
    function getAd(uint256 adId) public view returns (Ad memory) {
        require(adId < nextAdId, "Invalid adId");
        return ads[adId];
    }

    //      
    function checkJoinStatus(uint256 adId, uint256 influencerId) public view returns (bool) {
        return hasJoinedAd[adId][influencerId];
    }

    //   
